							"title": "政府 x 民間 x 網路 x 審議\n一個中介者的觀察與思考",
							"bio": "<p>05年開始為青年審議主持人出身，也陸續參與、協助學術研究團隊執行政府審議民主多項研究計劃，以及，協助民間團體進行內部工作坊或是相關程序論述，並協助或提供政府單位諮詢公民參與的實作想像、審議民主如何具體操作等相關培力、個案操作或制度建構。<br/>一個女人的精華歲月就在其中慢慢一點一滴的...</p>",
							"abstract": "<p>政府與民間的關係，在 2014 年後，從傳統的「由上而下」模式，透過「公民審議」的概念，似乎有了翻轉的契機。<br/>但是，身為「中介者」的規劃、主持人，時時必須面對：每場審議的議題設定，有多少是由公部門主導？又有多少能由民間社會主導？<br/>兩者間的平衡，必須建立在各方利益關係人一次次的實質交流上，才能逐漸調和公民培力、倡議者的視角，和政策規劃、研擬者的視角，從而建立真正的「審議系統」。<br/>所謂的「中介部門」，在面對不同性質的關係人時，有哪些溝通上的訣竅？<br/>所謂的「網路平台」，能扮演怎樣的角色，又有哪些未來可以努力的方向？</p>"
