						"title": "Voter's Guide for Legislators and Council Members",
						"bio": "<p>立委／議員投票指南</p>",
						"abstract": "<p>2014 議員選舉到 2016 立委選舉，投票指南在選前一個月都有四十到五十萬使用者<br/>投票指南的設計初衷是減少盲目投票，讓民主社會的台灣更進步<br/>究竟我們有沒有走到正確的道路上？</p>"
